c factors, such as instrument changes or station relocation. AHCCD was developed for use in climate research, including climate change studies. Long-term data records are often impacted by changes (e.g. site exposure, location, instrumentation, observer, and observing procedures) that are not related to climate. These non-climatic changes were detected and removed using statistical procedures. When necessary, data were corrected for some measurement techniques that are known to possibly lead to underestimations or overestimations. In addition, data from nearby stations were sometimes combined to create longer time series.\"}, \"id\": \"7536\", \"type\": \"panel.models.markup.HTML\"}, {\"attributes\": {}, \"id\": \"7363\", \"type\": \"WheelZoomTool\"}, {\"attributes\": {\"children\": [{\"id\": \"7515\"}, {\"id\": \"7516\"}], \"margin\": [0, 0, 0, 0], \"name\": \"Row21687\", \"sizing_mode\": \"stretch_width\"}, \"id\": \"7514\", \"type\": \"Row\"}, {\"attributes\": {\"margin\": [5, 5, 5, 5], \"name\": \"HTML21679\", \"sizing_mode\": \"stretch_width\", \"text\": \"Second Generation of Daily Adjusted Precipitation for Canada Update to December 2017\"}, \"id\": \"7513\", \"type\": \"panel.models.markup.HTML\"}, {\"attributes\": {\"children\": [{\"id\": \"7524\"}, {\"id\": \"7525\"}], \"margin\": [0, 0, 0, 0], \"name\": \"Row21702\", \"sizing_mode\": \"stretch_width\"}, \"id\": \"7523\", \"type\": \"Row\"}, {\"attributes\": {\"bottom_units\": \"screen\", \"fill_alpha\": 0.5, \"fill_color\": \"lightgrey\", \"left_units\": \"screen\", \"level\": \"overlay\", \"line_alpha\": 1.0, \"line_color\": \"black\", \"line_dash\": [4, 4], \"line_width\": 2, \"right_units\": \"screen\", \"syncable\": false, \"top_units\": \"screen\"}, \"id\": \"7366\", \"type\": \"BoxAnnotation\"}, {\"attributes\": {\"source\": {\"id\": \"7383\"}}, \"id\": \"7390\", \"type\": \"CDSView\"}, {\"attributes\": {\"margin\": [5, 5, 5, 5], \"name\": \"HTML21736\", \"sizing_mode\": \"stretch_width\", \"text\":
